import React, { Component } from 'react';

import './App.css';

const comment = {
  date: new Date(),
  text: 'I hope you enjoy',
  author: {
    name: 'hello kitty',
    avatarUrl: 'https://placekitten.com/g/64/64',
  }
}

function App(props){
  return(
    <div className="App">
        <h1>Title</h1>
        <p>This is the blog post paragraph</p>
        <p>{props.comment.text}</p>
      </div>
  )
}
export default App;
